import{_ as a,a as r,H as t,S as n,D as o,o as s}from"./chunks/framework.DX1C7ho2.js";const f=JSON.parse('{"title":"Monthly Updates [September]","description":"September 2023 updates.","frontmatter":{"title":"Monthly Updates [September]","description":"September 2023 updates.","date":"2023-09-01T00:00:00.000Z","next":false,"aside":"right","prev":false,"footer":true},"headers":[],"relativePath":"posts/sept-2023.md","filePath":"posts/sept-2023.md"}'),l={name:"posts/sept-2023.md"};function d(p,e,u,h,c,g){const i=o("Post");return s(),r("div",null,[t(i,{authors:"nbats"}),e[0]||(e[0]=n('<div class="info custom-block"><p class="custom-block-title">INFO</p><p>These update threads only contains major updates. If you&#39;re interested in seeing all minor changes you can follow our <a href="https://github.com/Lost Pages/Lost Pagesedit/commits/main" target="_blank" rel="noreferrer">Commits Page</a> on GitHub or <a href="https://redd.it/17f8msf" target="_blank" rel="noreferrer">Updates Channel</a> in Discord.</p></div><h3 id="wiki-updates" tabindex="-1">Wiki Updates <a class="header-anchor" href="#wiki-updates" aria-label="Permalink to &quot;Wiki Updates&quot;">​</a></h3><ul><li><p>Split Linux Tools into subcategories: <a href="/linuxguide/#linux-system">System</a>, <a href="/linuxguide/#linux-apps">Apps</a>, <a href="/linuxguide/#linux-internet">Internet</a>, <a href="/linuxguide/#terminal--shell">Terminal / Shell</a> and <a href="/linuxguide/#customization">Customization</a>.</p></li><li><p>NSFW has been <a href="/nsfwpiracy/">overhauled</a> with a bunch of new sites and sections.</p></li><li><p>Added Z-Libs new <a href="/readingpiracyguide/#reading-sites">Desktop App / Extension</a> in Reading Sites.</p></li><li><p>Replaced 9anime with <a href="/videopiracyguide/#anime-streaming">AniWave</a> as they&#39;ve <a href="https://torrentfreak.com/9anime-rebrands-to-aniwave-citing-legal-troubles-230802/" target="_blank" rel="noreferrer">rebranded</a> to avoid blocking.</p></li><li><p>Replaced link to IDM in Download Managers with <a href="/storage/#file-download-managers">activation script</a>.</p></li><li><p>Replaced /r/VPN with <a href="https://www.reddit.com/r/vpns/" target="_blank" rel="noreferrer">/r/VPNs</a> in our sidebar, as it allows users to discuss providers.</p></li></ul><h3 id="stars-added-⭐" tabindex="-1">Stars Added ⭐ <a class="header-anchor" href="#stars-added-⭐" aria-label="Permalink to &quot;Stars Added ⭐&quot;">​</a></h3><ul><li><p>Starred SusFlix and The Movie Archive in <a href="/videopiracyguide/#multi-server">Streaming Sites</a>. Big libraries, 4K quality.</p></li><li><p>Starred <a href="/videopiracyguide/#drives--directories">Dhokla</a> in video downloading. Big drive, fast downloads.</p></li><li><p>Starred <a href="https://github.com/LiLittleCat/awesome-free-chatgpt/blob/main/README_en.md" target="_blank" rel="noreferrer">Awesome Free ChatGPT</a> in AI Chatbots. Huge list of free chatbots.</p></li><li><p>Starred <a href="/storage/#compression-programs">NanaZip</a> in File Archivers. Open-source, modern design, preferred over 7-Zip by some.</p></li><li><p>Starred <a href="/torrentpiracyguide/#torrent-clients">Deluge</a> in Torrent Clients. Open-source client with many useful <a href="https://dev.deluge-torrent.org/wiki/Plugins" target="_blank" rel="noreferrer">plugins</a>.</p></li><li><p>Starred <a href="/android-iosguide/#android-audio">InnerTune</a> in Android Audio. Open-source YouTube Music client.</p></li><li><p>Starred APKPure and UpToDown in <a href="/android-iosguide/#untouched-apks">Untouched APKs</a>.</p></li><li><p>Starred EverythingMoe and Ripped in <a href="/miscguide/#indexes">Indexes</a>. Solid Piracy Indexes.</p></li><li><p>Starred <a href="/readingpiracyguide/#comic-sites">ReadAllComics</a> in Comics. Big library, no captcha.</p></li><li><p>Starred <a href="/videopiracyguide/#sports-streaming">WatchWrestling24</a> in Sports Streaming. Good video hosts, quick uploads.</p></li><li><p>Starred <a href="/adblockvpnguide/#antivirus">Sandboxie Plus</a> in Antivirus. User-friendly software sandbox / <a href="https://rentry.co/sandboxie-guide" target="_blank" rel="noreferrer">Guide</a>.</p></li><li><p>Starred <a href="/miscguide/#shopping">DarkPatternsTipline</a> in Shopping. Deceptive Service Design Tipline.</p></li><li><p>Starred <a href="/storage/#package-managers">Scoop</a> in Package Managers. Command-line installer for Windows.</p></li><li><p>Starred <a href="/toolsguide/#file-tools">SA Drive</a> in File Tools. Google Service Account Drive Manager.</p></li><li><p>Starred <a href="/storage/#image-upscalers">OpenModelDB</a> in Image Upscaling. Upscaling Model Database.</p></li><li><p>Starred <a href="/toolsguide/#video-tools">EyeCndy</a> in Video Tools. Camera technique library.</p></li></ul><h3 id="things-removed" tabindex="-1">Things Removed <a class="header-anchor" href="#things-removed" aria-label="Permalink to &quot;Things Removed&quot;">​</a></h3><ul><li><p>We&#39;ve stopped accepting and started removing all AI tools that require paid API keys to function.</p></li><li><p>Removed FileCR as they&#39;ve been <a href="https://rentry.co/filecr_malware" target="_blank" rel="noreferrer">caught with malware</a>, and still haven&#39;t removed it.</p></li><li><p>Removed AnonFiles as they&#39;ve decided to quit due to people <a href="https://i.imgur.com/lXoEqAV.png" target="_blank" rel="noreferrer">abusing the site</a>.</p></li><li><p>Unstarred WinRar in File Archivers. People feel its not as useful anymore given open-source options like 7-Zip / NanaZip.</p></li><li><p>Removed RVX from ReVanced section as its been <a href="https://github.com/inotia00/revanced-documentation/wiki/Announcement" target="_blank" rel="noreferrer">discontinued</a>.</p></li><li><p>Removed PDF Drive in PDF Sites as downloads no longer work.</p></li><li><p>Removed TronScript in Debloaters. Some people consider it <a href="https://i.imgur.com/K5hf5Bu.png" target="_blank" rel="noreferrer">overkill</a>.</p></li><li><p>Removed Poe in AI Chatbots as its now limited to 10 daily messages (or 100 in some countries.)</p></li><li><p>Removed the &quot;Everything I Know&quot; wiki from Indexes as they&#39;ve gone <a href="https://i.imgur.com/ig8jPGL.jpg" target="_blank" rel="noreferrer">paid</a>. You can get around it by blocking the overlay, but we&#39;re not interested in sending traffic their way anymore.</p></li><li><p>Unstarred 1337x and added <a href="https://pastebin.com/Rc9MYMZ7" target="_blank" rel="noreferrer">warning</a> to avoid software / games, as they&#39;ve had issues with malware, including a torrent that was up for days after being reported. They did remove it eventually, and <a href="https://i.imgur.com/ij4CXIm.png" target="_blank" rel="noreferrer">respond</a> to the situation, so we feel it would be unfair to remove their site entirely. Our hope is that 1337x acts quicker in the future, avoids situations like this, and begins to earn trust back from people over time.</p></li></ul>',7))])}const v=a(l,[["render",d]]);export{f as __pageData,v as default};
